import styled from "styled-components";
import InfiniteScroll from "react-infinite-scroll-component";
import { Spin } from "antd";

import { ICouponList } from "@interfaces";
import { CouponItem } from "./Item";

interface IProps {
    data: ICouponList[];
    handleReceive: (id: string) => void;
    handleLoadMore: () => void;
    loadingPagination: boolean;
}

export const ComponentCouponList = (props: IProps) => {
    const { data, handleReceive, handleLoadMore, loadingPagination } = props;

    return (
        <StyledContainerCouponList>
            <InfiniteScroll
                dataLength={data.length}
                next={handleLoadMore}
                hasMore={true}
                loader={
                    <div className="example">
                        <Spin size="large" spinning={true} />{" "}
                    </div>
                }
            >
                {data.map((item, index) => {
                    return (
                        <CouponItem handleReceive={handleReceive} data={item.qrtable} key={index} />
                    );
                })}
            </InfiniteScroll>
        </StyledContainerCouponList>
    );
};

const StyledContainerCouponList = styled.div`
    width: 90%;
    margin: 0 auto;
    padding: 25px 0;
    position: relative;
    .example {
        margin: 20px 0;
        margin-bottom: 20px;
        padding: 30px 50px;
        text-align: center;
        background: rgba(0, 0, 0, 0.05);
        border-radius: 4px;
    }
`;
